import React from 'react';
import './style.css';

import { TbDots} from 'react-icons/tb';
import { IoMdHeartEmpty } from 'react-icons/io';
import { IoPaperPlaneOutline } from 'react-icons/io5'
import { FiBookmark } from 'react-icons/fi';
import { FaRegComment } from 'react-icons/fa';

import Foto from '../../assets/img/img_01.jpg';
import User from '../../assets/img/foto.png';

export const Card = () => {
    return(
        <div className="card-container">
            <div className="card-header-container">
                <img src={User} alt='Foto do usuário' />
                < TbDots size={18} />
            </div>
            <div className="card-foto">
                <img src={Foto} alt="foto FFXIV" />
            </div>
            <div className="card-icones-container">
            < IoMdHeartEmpty size={25} className="card-icones" />
            < FaRegComment size={25} className="card-icones" />
            < IoPaperPlaneOutline size={25} className="card-icones" />
           
            < FiBookmark size={25} className="card-icones-right" />
            <p>1.000 visualizações</p>
            
            </div>
            <div className="card-comentarios-container">
                <p></p>
                <p></p>
                <p></p>
            </div>
            <div className="card-novos-comentarios">input</div>
        </div>
    )
}

export default Card;
